export const transpose = function(outerlist) {
  var i = 0
  var result = []
  while (i < outerlist.length) {
    // console.log(i)
    // console.log(outerlist[i])
    var innerlist = outerlist[i]
    var j = 0
    while (j < innerlist.length) {
      // console.log(j)
      if (typeof result[j] === 'undefined') {
        result[j] = []
      }
      console.log(result)
      result[j].push(innerlist[j])
      j += 1
    }
    i += 1
  }
  return result
}

export const test = function(test) {
  var array = [];
  test.forEach((d,i) => {
    d.forEach((e, j) => {
      if (typeof array[j] === 'undefined') {
        array[j] = []
      }
      array[j].push(e)
    })
  })
  return array
}
